import React from "react";
import classes from "./Blog.module.css";
const Blogcontent = (props) => {
  return (
    <div className={classes.blogmain}>
      <img src="" alt />
      <div>
        <h4>{props.body}</h4>
        <p>{props.para}</p>
      </div>
    </div>
  );
};
export default Blogcontent;
